import React, { Component } from 'react';
import Telephone from '../../telephone';

class Familiencafe extends Component {
    state = {  } 
    render() { 
        return  <>
                    <h2>Familiencafe</h2>
                    <p>
                        Seid ihr neu in der Stadt oder wollt neue Kontakte knüpfen? Dann seid ihr hier genau richtig! <br />Dieses Angebot bietet eine entspannte Möglichkeit, sich mit anderen Familien auszutauschen. Hier könnt ihr ungezwungen ins Gespräch kommen und euch über Erziehung, den Alltag und die Veränderungen im Leben mit Kindern austauschen.
                    </p>
                    <p>
                        Das Leben mit Kindern fordert Eltern und Großeltern in vielerlei Hinsicht heraus. Im Alltagsstress verliert man manchmal aus den Augen, was wirklich wichtig ist und was einen mit den Kindern oder Enkeln verbindet.
                    </p>
                    <p>
                        Im Familiencafé findet ihr bestimmt Gemeinsamkeiten, frische Ideen und hilfreiche Ratschläge. Die gemeinsame Zeit kann euch helfen, entspannter mit euch selbst und euren (Enkel-)Kindern umzugehen. Eine Betreuung ist nicht vorgesehen, dafür gibt eine entspannte Atmosphäre bei Cafe & Kuchen, gemeinsames Spielen, (Basteln) und Lachen.
                    </p>
                    <p>
                        Melden Sie sich gerne unter: &nbsp;
                        <Telephone />
                    </p>
                </>;
    }
}

export default Familiencafe;
